import { restart } from '../utils/functions'
import { MessageType } from '@adiwajshing/baileys'

module.exports = {
    name: 'restart',
    description: 'Untuk merestart bot _only owner_',
    async execute (client: any, chat: any, pesan: any, args: any) {
        if (!client.isOwner && !client.isSudo) return client.reply(pesan.hanya.owner)
        const from = client.from
        const shutdownBase64 = '' // Big Blobs
        await client.sendMessage(from, shutdownBase64, MessageType.audio, { mimetype: 'audio/mpeg', filename: 'shutdown.mp3', quoted: chat })
        await restart()
    }
}
